import React from 'react'
import NavBar from './NavBar'
import Findfollow from './Findfollow'
import Shoutform from './Shoutform'
import Newsfeed from './Newsfeed'

class Home extends React.Component{
    constructor(){
        super()
        this.state = {
                userInfo: {}
        }
    }

    componentDidMount(){
        this.setState({
           userInfo: this.props.userInfo.userInfo 
        })

        console.log('home state', this.state)
    }


    render(){
        // console.log('home state', this.state)
        return(
            <div>
                <NavBar userId = {this.state.userInfo}/>
                <div>
                    <h1>Home</h1>

                    <div>Header: picture and bio</div>
                </div>



                <Shoutform/>
                <Findfollow/>
                <Newsfeed followed_shouts = {this.props.followed_shouts}/>

            </div>
        )
    }
}

export default Home
